import React, { useState, useEffect } from "react";
import Content from "../../components/Content";
import axios from "axios";
import Button from "@mui/material/Button";
import IconButton from "@mui/material/IconButton";
import EditIcon from "@mui/icons-material/Edit";
import DeleteIcon from "@mui/icons-material/Delete";
import PersonAddIcon from "@mui/icons-material/PersonAdd";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import Layout from "../../containers/Layout";
import { useParams } from "react-router-dom";
import { useNavigate } from "react-router-dom";
import AgendaServices from "../../services/AgendaServices";

const PacientesAgenda = (id) => {
  const [idPaciente, setidPaciente] = useState("");
  const [nomPaciente, setnomPaciente] = useState("");
  const [ap1Paciente, setap1Paciente] = useState("");
  const [ap2Paciente, setap2Paciente] = useState("");
  const [agenda, setAgenda] = useState([]);
  
  const routeParams = useParams();
  const navigate = useNavigate();
  const server = `http://localhost:4002`;

  var datos;

  const getData = async () => {
    const { data } = await axios.get(`${server}/pacientes/${routeParams.id}`);
    setidPaciente(data.idPaciente);
    setnomPaciente(data.nomPaciente);
    setap1Paciente(data.ap1Paciente);
    setap2Paciente(data.ap2Paciente);
    console.log(data);

    const  data2  = await AgendaServices.getAgenda();
    console.log(data2);

    const idPxenAgenda = Object.entries(data2);
    console.log(idPxenAgenda);
    
  };

  useEffect(() => {
    getData();
  }, []);

  


  return(
    <Content>
      
      <label> idPaciente: {idPaciente} </label>
    </Content>
  );
};

export default PacientesAgenda;
